import React from "react";
import ReactDOM from "react-dom";

import "assets/styles/base.css";
import TopBar from "components/common/TopBar";
import Flow from "components/Flow";

const App = () => (
  <>
    <TopBar />
    <Flow />
  </>
);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
